import React, { useState } from 'react'
import {Slider} from '@material-ui/core'



export default function App() {


    const mark=[
      {
        value:0,
        label:'start',
      },
      {
        value:100,
        label:'middle',
      },
      {
        value:200,
        label:'stop',
      },
    ]


    const handleChange=(e)=>{
      console.log(e.target.value )
    }

  return (
    <div>
              <div style={{width:'300px',marginLeft:'60px',marginTop:'70px'}}>
                       <Slider color='secondary' defaultValue={90} max={200} marks={mark} valueLabelDisplay='auto' onChange={handleChange} orientation='vertical'/>
              </div>

    </div>
  )
}
